def coin_list():
    coins = client.get_coin_list()
    coinlist=[]
    for m in coins:
        coinlist.append(m['coin'])
    return coinlist

#pprint (coinlist)



def list_markets():
    markets=client.get_trading_symbols('BTC')
    marketlist=[]
    for m in markets:
        marketlist.append(m['symbol'])
    return marketlist

#pprint(marketlist)

def get_all_current_prices(markets):
    for n in markets:
        tick = client.get_tick(n)
        price=tick["symbol"], "%0.9f" % tick["lastDealPrice"]
    return price

def get_current_price(coinshort):
    coin="{}-BTC".format(coinshort)
    tick = client.get_tick(coin)
    print(tick["symbol"], "%0.9f" % tick["lastDealPrice"])
    return tick['lastDealPrice']





