def get_tradingvolume_mean(symbol,time):
    time_in_minutes="{} minutes ago UTC".format(time)
    symbol="{}-BTC".format(symbol)
    liste=client.get_historical_klines_tv(symbol, Client.RESOLUTION_1MINUTE, time_in_minutes)
    vol=[]
    sum=0
    for n in liste:
        vol.append(n[-1])
        sum=sum+n[-1]
    mean=sum/len(vol)
