def data_since(time,data):
    list=[]
    print(data)
    for x in data:
        if time <= x[0]:
            list.append(x)
    return list


def get_start_time(minutes):
    h=60*minutes
    now=current_datetime()
    startpoint=now-h
    return startpoint


def get_market_records(klinesdata,marketname):
    market_records=klinesdata[marketname]
    return market_records

def get_records_since(market_records,start_time):
    records=[]
    for rec in market_records:
#        print(start_time, rec)
        if rec[0]>=start_time:
            records.append(rec)
    return records

def get_prices_from_records(records):
    prices=[rec[1] for rec in records]
    return prices



def calc_mean_of_values(values):
    sum = 0
    for n in values:
        sum = sum + n
    mean = sum / len(values)
    return mean


def get_means_of_market(klinesdata, marketname):
    data = {}
    data['market']=marketname
    records = get_market_records(klinesdata,marketname)
    start_time1 = get_start_time(60)
    start_time2 = get_start_time(120)
    records_since = get_records_since(records, start_time1)
    prices = get_prices_from_records(records_since)
    mean1 = calc_mean_of_values(prices)
    data['mean_1']=mean1
    records_since = get_records_since(records, start_time2)
    prices = get_prices_from_records(records_since)
    mean2 = calc_mean_of_values(prices)
    data['mean_2'] = mean2
    return data


def get_market_mean_summary(klinesdata):
    lst=[]
    markets=klinesdata
    for market in markets:
        data=get_means_of_market(klinesdata, market)
        lst.append(data)
    return lst







